#define ENABLE_CPS_LOG CPS_LOG_ERR

#define cps_wls_log(num, fmt, ...) \
	do { \
		if (ENABLE_CPS_LOG >= (int)num) \
			printk(KERN_ERR "[cps8601]:" pr_fmt(fmt), ##__VA_ARGS__); \
	} while (0)

